import React from 'react';
import styled from 'styled-components';
import BrandLogo from '../brandLogo';

const NavbarContainer = styled.div`
width: 100%;
height: 85px;
display: flex;
align-items center;
background-color:black;
`;

export default function navbar(props) {
    return (
        <NavbarContainer>
            <BrandLogo />
        </NavbarContainer>
    );
}
